import styled, { css } from 'styled-components';

export const removeDefaultPageStyle = css`
  border 0;
  padding: 0;
  font-family: inherit;
  font-weight: normal;
  background-color: unset;
`;

export const DashboardHead = styled.div`
  ${removeDefaultPageStyle};
  text-align: center;
  align-items: center;
  margin: auto;
`
